import React from 'react'
import styled from 'styled-components'

const StyledButton = styled.button`

position: absolute;
width: 271px;
height: 38px;
left: 1013px;
top: 273px;

background: #916BBF;
border: none;
border-radius: 109px;
`
export default function Button(props) {
  return (
  <StyledButton type={props.type}>
{props.value}
  </StyledButton>
  );
}
